INSERT INTO `locales_target` VALUES (24,'Habilitar módulos de desarrollador','es',0,0),(25,'Deshabilitar módulos de desarrollados','es',0,0),(26,'Ajustar magen superior','es',0,0),(27,'Si está habilitado, la salida del sitio será desplazada aproximadamente 20 pixeles hacia abajo para mostrar el menú de administración. Si está deshabilitado, algún elemento de posición absoluta o fija en la página, puede ser cubierto por el menú de administración.','es',0,0),(28,'Mantener menú en la parte superior de la página','es',0,0),(29,'Si está habilitado, el menú de administración siempre será mostrado en la parte superior de la vista del navegador (el resto de la página será desplazada). <strong>Importante: En algunos navegadores, esta opción puede ocasionar una página malformada, un cursor invisible, elementos no seleccionables en los formularios, y otras consecuencias. Deshabilite este opción si algo de esto ocurre.</strong>','es',0,0),(30,'Opciones avanzadas','es',0,0),(31,'Colapsar campos en la página de módulos','es',0,0),(32,'Si está habilitado, los campos en la <a href=\"!modules-url\">página de modulos</a> son automáticamente colapsados cuando carga la página.','es',0,0),(33,'Si el módulo Utility fue instalado para este propósito, puede ser deshabilitado y desinstalado en forma segura.','es',0,0),(34,'Mover tareas locales dentro del menú','es',0,0),(35,'Si está habilitado, las tabs en la página actual serán movidas dentro del menú de administración. Esta característica sólo está disponible en los temas que usen las clases CSS <code>tabs primary</code> y <code>tabs secondary</code> para las tabs.','es',0,0),(36,'Si el menú de administración muestra items duplicados, necesita reconstruir sus items usando el botón <em>Borrar y rearmar</em>.','es',0,0),(37,'Borrar y rearmar','es',0,0),(38,'Opciones del menú de administración','es',0,0),(39,'Ninguno','es',0,0),(40,'ID enlace del menú','es',0,0),(41,'Peso','es',0,0),(42,'ID enlace del padre','es',0,0),(43,'Mostrar datos adicionales para cada item del menú','es',0,0),(44,'Mostrar los items seleccionados próximos a cada enlace del item del menú.','es',0,0),(45,'Mostrar todos los items del menú','es',0,0),(46,'Si está habilitado, todos los items del menú serán mostrados a pesar de los permisos. <em>Importante: No usar en un sitio en producción.</em>','es',0,0),(47,'Habilitar estos mulos: !module-list.','es',0,0),(48,'Deshabilitar estos mulos: !module-list.','es',0,0),(49,'No están habilitados módulos de desarrollador.','es',0,0),(50,'El módulo menú de administración, provee un menú desplegable organizado para que con uno o dos clicks se pueda acceder a la mayoría de las tareas administrativas y otros destinos comunes (para los usuarios con los permisos apropiados). Use las opciones siguientes para personalizar la apariencia del menú.','es',0,0),(51,'El módulo menú de administración, provee un menú desplegable organizado para que con uno o dos clicks se pueda acceder a la mayoría de las tareas administrativas y otros destinos comunes (para los usuarios con los permisos apropiados). El menú de administración además muestra el número de usuarios anónimos y registrados, y permite agregar a los módulos su propio item personalizado en el menú. La integración con el menú varia de módulo a módulo, por ejemplo, el módulo <a href=\"@drupal\">Devel</a>, hace un fuerte uso del menú de administración para proveer un rápido acceso a las herramientas de desarrollo.','es',0,0),(52,'La <a href=\"@settings\">página de opciones</a> del menú de administración, permite modificar algunos elementos del comportramiento del menú y apariencia. Ya que la apariencia del menú depende del tema de sitio, personalizaciones importantes requieren modificaciones de CSS y de los archivos del tema. Vea el archivo README.txt del módulo avanzado para más información sobre personalizaciones en el tema y CSS.','es',0,0),(53,'Los items mostrados del menú de administración dependen de los permisos del usuario. Primero, el menú de administración sólo es mostrado a los usuarios en los roles con <em>acceso al menú de administración</em> (módulo admin_menu). Segundo, un usuario debe ser miembro de un rol con el permiso de <em>Acceder a las páginas de administración</em> (módulo system) y los enlaces administrativos. Y tercero, sólo los enlaces permitidos serán mostrados, por ejemplo, si un usuario no es miembro de un rol con los permisos <em>Permisos de administración</em> (módulo user) y <em>Administrar usuarios</em> (módulo user), el item del menú <em>Gestión de usuarios</em> no será mostrado.','es',0,0),(54,'Usuarios anóninos/registrados  actuales','es',0,0),(55,'@count-anon / @count-auth !icon','es',0,0),(56,'Acceso a menú de administración','es',0,0),(57,'Mostrar enlaces de Drupal','es',0,0),(58,'Menú de administración','es',0,0),(59,'Ajustar opciones del menú de administración.','es',0,0),(60,'admin_menu','es',0,0),(61,'Provee un menú desplegable para la mayoría de las tareas administrativas y otros destinos comunes (para los usuarios con los permisos apropiados).','es',0,0),(62,'Administración','es',0,0),(63,'Longitud máxima','es',0,0),(64,'La longitud máxima del campo en caracteres. Déjalo en blanco para un tamaño ilimitado.','es',0,0),(65,'es igual a','es',0,0),(66,'no es igual a','es',0,0),(67,'coincide con el patrón','es',0,0),(68,'Valor ilegal para %name.','es',0,0),(69,'Filas','es',0,0),(70,'\"Filas\" debe ser un valor positivo entero.','es',0,0),(71,'duplicar','es',0,0),(72,'Valores permitidos','es',0,0),(73,'Los valores posibles que este campo puede contener. Cualquier otro valor puede dará error. Ingresar un valor por linea.','es',0,0),(74,'Permitir a los administradores definir nuevos tipos de contenidos.','es',0,0),(75,'añadir un tipo de contenido','es',0,0),(76,'los campos','es',0,0),(77,'configurar los campos','es',0,0),(78,'borrar el campo','es',0,0),(79,'Define un tipo de campo para referenciar un nodo de otro. <em>Nota: Requiere content.module.</em>','es',0,0),(80,'autocom