 texto separadas por comas</strong> si quiere permitir un enlace con IMCE. Tenga en cuenta que la ID de los campos del cupero de la mayoría de los tipos de nodos es edit-body.','es',0,0),(214,'URLs absolutas','es',0,0),(215,'Márquelo si quiere que IMCE proporcione las URLs absolutas de los documentos.','es',0,0),(216,'La conducta predefinida para los documentos ya existentes al subir documentos al servidor','es',0,0),(217,'Conservar el documento existente y renombrar el nuevo','es',0,0),(218,'Conservar el documento existente y rechazar el nuevo','es',0,0),(219,'Remplazar el documento existente por el nuevo','es',0,0),(220,'El método predefinido de creación de miniaturas','es',0,0),(221,'Escalar la imagen con respecto a las dimensiones de la miniatura.','es',0,0),(222,'Primero escale y luego recorte la imagen para que encaje en las dimensiones de miniatura','es',0,0),(223,'Guardar configuración','es',0,0),(224,'Rol de usuario','es',0,0),(225,'Perfil asignado','es',0,0),(226,'usuario #1','es',0,0),(227,'n/d','es',0,0),(228,'Para los usuarios que tienen varios roles, será el peso de cada propiedad lo que determine el perfil asignado. Los roles más ligeros, que se situan más arriba en los listados, predominarán. De ese modo, el rol de administrador debería colocarse encima de roles con menor peso (como -10).','es',0,0),(229,'Asignaciones de rol y perfil','es',0,0),(230,'Asignar perfiles a roles de usuario.','es',0,0),(231,'Los cambios se han guardado.','es',0,0),(232,'Se han importado las opciones de configuración del perfil %name','es',0,0),(233,'De un nombre a este perfil.','es',0,0),(234,'Tamaño máximo del archivo por carga','es',0,0),(235,'Establézcalo en 0 para usar el máximo valor disponible.','es',0,0),(236,'Su configuración de PHP limita el tamaño máximo por subida de archivo a %size MB.','es',0,0),(237,'MB','es',0,0),(238,'Cuota del directorio','es',0,0),(239,'Define la cuota de subida de documentos por directorio. La cuota total del usuario es proporcional al número de directorios a los que ese usuario tenga derechos de subida de documentos.','es',0,0),(240,'Cuota total del usuario','es',0,0),(241,'Puede disponer una quota máxima de usuario que sea independiente de la cuota de directorio. Esta cuota se calculará usando la tabla de documentos de la base de datos, por lo que no se incluirán aquellos documentos que se hayan subido con FTP o con versiones anteriores de IMCE (4.7.x y 5.x). Puede usar ambas restricciones juntas o, de forma más segura, dejar este valor en 0.','es',0,0),(242,'Extensiones de archivos permitidas','es',0,0),(243,'Las extensiones que los usuarios de este rol pueden cargar. Las extensiones se deben separar con un espacio y no deben incluir el punto inicial.','es',0,0),(244,'Ponga * para eliminar las restricciones.','es',0,0),(245,'Resolución máxima de la imagen','es',0,0),(246,'El tamaño máximo permitido para las imágenes; por ejemplo: 640 × 480. Déjelo en 0 si no quiere limitarlo. Si tiene instalado algún juego de <a href=\"!image-toolkit-link\">herramientas de imagen</a>, las imágenes que excedan esas dimensiones se reducirán para ajustarse.','es',0,0),(247,'ANCHO × ALTO','es',0,0),(248,'Número máximo de documentos por operación','es',0,0),(249,'Puede permitir que los usuarios selecciones varios documentos para operaciones como borrar, redimensionar, etc... Cada operación multiple se ejecutará con una sóla carga de Drupal, lo que puede ser bueno. Sin embargo, habrá un aumento en la ejecución de la secuencia de órdenes, de carga de la CPU y de consumo de memoria. Esto podría superar los límites del servidor, <strong>lo que es realmente malo.</strong> Para disponer un número ilimitado de documentos, deje el valor en 0.','es',0,0),(250,'Se han guardado los cambios.','es',0,0),(251,'El perfil se ha añadido.','es',0,0),(252,'Incluyendo subdirectorios','es',0,0),(253,'Explorar','es',0,0),(254,'Upload','es',0,0),(255,'Miniaturas','es',0,0),(256,'Redimensionar','es',0,0),(257,'Ruta del directorio','es',0,0),(258,'Directorios','es',0,0),(259,'Defina directorios a los que los usuarios con este perfil pueden acceder.\n<ul>\n	<li>Use sólo caracteres alfanuméricos como rutas de los directorios.</li>\n	<li>Para especificar la la raiz del sistema Drupal, use un caracter (.) de punto.</li>\n	<li>Utilice <em>%uid</strong> como contenedor de la ID de usuario; por ejemplo: <em>users/user%uid</em> creará directorios como <em>users/user1</em>, <em>users/user42</em>, etc...</li>\n<li>Para eliminar un directorio de la lista, deje su ruta en blanco.</li>\n<li>Si quiere una mayor flexibilidad en las rutas de los directorios, use PHP para obtener una ruta de diectorio.<br />\nPara ese uso de PHP, su directorio debe comenzar con <em>php:</em> y el resto debe ser una cadena de PHP válida, de la que se espere que devuelva la ruta actual del directorio.<br />Por ejemplo: <em>php: return \'users/\'.$user->name;</em> define como ruta del directorio <em>users/USER-NAME</em><br />\nUn ejemplo de directorio multinivel: <em>php: return date(\'Y\', $user->created).\'/\'.date(\'m\', $user->created).\'/\'.$user->uid;</em> define <em>MEMBERSHIP-YEAR/MONTH/USER-ID</em> como ruta del directorio, lo que resultará en directorios de usuario categorizados sobre la base de la fecha de inscripción como usuarios.<br />\nTenga en cuenta que debería usar la variable <em>$user</em> en vez de <em>$GLOBALS[\'user\']</em> ya que no siempre son el mismo objeto.</li>\n</ul>\n<p>Tenga también presente que los permisos de miniaturas no afectan a la creación de miniaturas al subir archivos. Consulte la creación de miniaturas más adelante.</p>\n<p>Si necesita más campos, escríba y guarde. Tendrá dos más en la página siguiente.</p>','es',0,0),(260,'Nombre','es',0,0),(261,'Dimensiones','es',0,0),(262,'Prefijo','es',0,0),(263,'Sufijo','es',0,0),(264,'Puede crear una lista de opciones de miniaturas para que los usuarios elijan.\n<ul>\n  <li>Use sólo caracteres alfanuméricos como nombres de miniaturas.</li>\n  <li>Especifique las dimensiones de forma Ancho × Alto.</li>\n  <li>Los prefijos y sufijos son textos que se añaden al nombre de cada documento para crear el de la correspondiente miniatura.</li>\n  <li>Un ejemplo de miniatura es: Nombre = <em>Pequeno</em>, Dimensiones = <em>80 × 80</em>, Prefijo = <em>mini_</em></li>\n</ul>\n<p>Tenga en cuenta que los usuarios siempre podrán crear miniaturas al subir documentos. sin importa cuál sea el permiso de miniaturas. Para desactivar la creación de miniaturas al subir documentos, lo que debe hacer es no definir aquí miniaturas.</p>\n<p>Si necesita más campos, escríba y guarde. Tendrá dos más en la página siguiente.</p>','es',0,0),(265,'¿Está seguro de querer borrar el perfil %name?','es',0,0),(266,'Cancelar','es',0,0),(267,'El perfil se ha borrado.','es',0,0),(268,'ninguno','es',0,0),(269,'Importar opciones de configuración de otros perfiles','es',0,0),(270,'las rutas de directorio duplicadas no se permiten.','es',0,0),(271,'%dirnameno es aceptable como nombre de directorio.','es',0,0),(272,'Crear miniaturas','es',0,0),(273,'Archivo','es',0,0),(274,'Subir fichero','es',0,0),(275,'Documentos seleccionados','es',0,0),(276,'Ancho × alto','es',0,0),(277,'Crear imagen nueva','es',0,0),(278,'Seleccione un documento, por favor.','es',0,0),(279,'No tiene permiso para actuar sobre más de %num documentos.','es',0,0),(280,'directorio (%dir)','es',0,0),(281,'Se detectó una selección ilegal. Por favor póngase en contacto con el administrador del sitio.','es',0,0),(282,'El documento se ha renombrado %filename.','es',0,0),(283,'%filename se ha copiado al servidor.','es',0,0),(284,'La subida no se pudo efectuar.','es',0,0),(285,'Documentos borrados satisfactoriamente: %files.','es',0,0),(286,'Especifique unas dimensiones dentro de las permitidas, por favor. Eso va desde 1 × 1 a @dimensions.','es',0,0),(287,'sin límite','es',0,0),(288,'Redimensionado de documento(s) realizado satisfactoriamente: %files.','es',0,0),(289,'Creación de miniatura(s) (%thumbnam