e documentos','es',0,0),(24,'Activer les modules pour développeur','fr',0,0),(25,'Désactiver les modules pour développeur','fr',0,0),(26,'Ajuster la marge du haut','fr',0,0),(27,'Si activé, le rendu du site est abaissé d\'à peu près 20 pixels depuis le haut de la vue pour afficher le menu d\'administration. Si désactivé, certains éléments de la page en positionnement absolu (absolute) ou fixe (fixed) peuvent être recouverts par le menu d\'administration.','fr',0,0),(28,'Garder le menu en haut de page','fr',0,0),(29,'Si activé, le menu d\'administration est toujours affiché en haut de l\'affichage du navigateur (même après un parcours de la page).<strong>Note : Dans certains navigateurs, ce paramètre a pour résultat une page mal formée, un curseur invisible, des éléments de formulaires non sélectionnables, ou d\'autres problèmes. Désactivez cette option si ces problèmes se produisent.</strong>','fr',0,0),(30,'Paramètres avancés','fr',0,0),(31,'Déplier les groupes de champs sur les pages des modules','fr',0,0),(32,'Si activé, les groupes de champs sur la page <a href=\"!modules-url\">modules</a> sont automatiquement dépliés au chargement de la page.','fr',0,0),(33,'Si le module Utility a été installé dans ce but, il peut être désactivé et désinstallé sans danger.','fr',0,0),(34,'Déplacer les tâches locales (local tasks) dans le menu','fr',0,0),(35,'Si activé, les onglets de la page courante sont déplacés dans le menu d\'administration. Cette fonctionnalité n\'est disponible que dans les thèmes qui utilisent les classes CSS <code>tabs primary</code> et <code>tabs secondary</code> pour les onglets.','fr',0,0),(36,'Si le menu d\'administration affiche des éléments de menu en doublon, vous aurez sans doute besoin de reconstruire vos éléments de menu, en utilisant le bouton <em>Effacer et reconstruire</em>.','fr',0,0),(37,'Effacer et reconstruire','fr',0,0),(38,'Paramètres du menu d\'administration','fr',0,0),(39,'Aucun','fr',0,0),(40,'ID du lien de menu','fr',0,0),(41,'Poids','fr',0,0),(42,'ID du lien parent','fr',0,0),(43,'Afficher des données additionnelles pour chaque élément de menu','fr',0,0),(44,'Afficher les éléments sélectionnés à côté de chaque lien d\'élément de menu.','fr',0,0),(45,'Afficher tous les liens du menu','fr',0,0),(46,'Si activé, tous les éléments de menu sont affichés, sans tenir compte des permissions de votre site.<em>Note : ne pas activer sur un site en production.</em>','fr',0,0),(47,'Vous avez activé ces modules : !module-list.','fr',0,0),(48,'Vous avez désactivé ces modules : !module-list.','fr',0,0),(49,'Aucun module de développeur n\'est activé.','fr',0,0),(50,'Le module de menu d\'administration fournit un menu déroulant, arrangé pour l\'accès en un ou deux clics à la plupart des tâches administratives, et à d\'autres destinations communes (pour les utilisateurs aux permissions appropriées). Utilisez les paramètres ci-dessous pour personnaliser l\'apparence du menu. ','fr',0,0),(51,'Le module de menu d\'administration fournit un menu déroulant, arrangé pour l\'accès en un ou deux clics à la plupart des tâches administratives, et à d\'autres destinations communes (pour les utilisateurs aux permissions appropriées). Le menu d\'administration affiche aussi le nombre d\'utilisateurs anonymes et authentifiés, et permet aux modules d\'ajouter leurs propres éléments de menu personnalisés. L\'intégration dans le menu varie selon le module; Par exemple, le module contribué <a href=\"@drupal\">Devel</a> utilise fortement le module de menu d\'administration pour fournir un accès rapide aux outils de développement.','fr',0,0),(52,'La <a href=\"@settings\">page de paramètres</a> du module d\'administration vous permet de modifier certains éléments de comportement et d\'apparence du menu. Puisque l\'apparence du menu est dépendante du thème de votre site, des personnalisations substantielles requièrent des modifications aux fichiers CSS et de thème de votre site. Voir le fichier de module avancé README.txt pour plus d\'informations sur les personnalisations de thème et de CSS.','fr',0,0),(53,'Les éléments de menu affichés dans le menu d\'administration dépendent des permissions réelles de l\'utilisateur. Premièrement, le menu d\'administration n\'est affiché que pour les utilisateurs aux rôles possédant la permission <em>Accéder au menu d\'administration</em> (module admin_menu). Deuxièmement, un utilisateur doit être membre d\'un rôle possédant la permission  <em>Accéder aux pages d\'administration</em> (module system), afin de voir les liens d\'administration. Enfin, troisièmement, seuls les liens réellement autorisés sont affichés. Par exemple, si un utilisateur n\'est pas membre d\'un rôle possédant la permission <em>Administrer les permissions</em> (module user), l\'élément de menu <em>Gestion des utilisateurs</em> n\'est pas affiché.','fr',0,0),(54,'Utilisateurs anonymes / authentifiés actuels','fr',0,0),(55,'@count-anon / @count-auth !icon','fr',0,0),(343,'Accueil','fr',0,0),(56,'accéder au menu d\'administration','fr',0,0),(57,'afficher les liens drupal','fr',0,0),(58,'Menu d\'administration','fr',0,0),(59,'Ajuster les paramètres du menu d\'administration','fr',0,0),(60,'admin_menu','fr',0,0),(61,'Fournit un menu déroulant pour les tâches administratives les plus courantes, et pour d\'autres destinations usuelles (pour les utilisateurs possédant les permissions appropriées).','fr',0,0),(62,'Administration','fr',0,0),(344,'Le module Content, composant obligatoire du kit CCK (Content Construction Kit) permet aux administrateurs d\'associer des champs personnalisés à des types de contenus. Au sein de Drupal, les types de contenus servent à définir les caractéristiques d\'une publication, y compris le titre et la description des champs affichés sur ses pages \"ajouter\" et \"éditer\". Le module Content (et les modules auxiliaires inclus dans CCK) permet d\'ajouter des champs personnalisés en plus des champs par défaut \"Titre\" et \"Corps\". Les fonctionnalités de CCK sont accessible via différents onglets sur la <a href=\"@content-types\">page d\'administration des types de contenus</a>. (Voir la <a href=\"@node-help\">page d\'aide du module Node</a> pour plus d\'informations sur les types de contenus).','fr',0,0),(345,'Lorsque vous ajoutez un champ personnalisé à un type de contenu, vous déterminez son type (c\'est-à-dire s\'il doit contenir du texte, des nombres ou des références à d\'autres objets) et la façon dont il doit être affiché (en tant que champ ou zone de texte, liste de sélection, case à cocher, bouton radio, ou champ à auto-complètement). Un champ peut présenter plusieurs valeurs (par exemple, une \"personne\" peut disposer de plusieurs adresses e-mail) ou une seule (par exemple, un \"employé\" possède un numéro d\'identification unique). À mesure que vous ajoutez et modifiez des champs, CCK ajuste automatiquement la structure de la base de données en fonction. CCK propose également un certain nombre d\'autres fonctionnalités, par exemple un cache intelligent pour vos données personnalisées, des fonctionnalités d\'import et d\'export pour les définitions de types de contenus, ainsi qu\'une intégration à d\'autres modules provenant des contributions.','fr',0,0),(346,'Des types de champs personnalisés sont proposés par plusieurs modules optionnels inclus dans CCK (chaque module fournissant un type différent). La <a href=\"@modules\">page des modules</a> vous permet d\'activer ou de désactiver des composants CCK. Une installation par défaut de CCK inclut :','fr',0,0),(347,'<em>Number</em>, qui ajoute des types de champs numériques (formats entier, décimal ou réel à virgule flottante). Vous pouvez définir un jeu ou un intervalle de valeurs autorisées. Divers formats sont disponibles pour l\'affichage des données numériques.','fr',0,0),(348,'<em>Text</em>, qui ajoute des types de champs de texte. Un champ texte peut contenir du texte brut uniquement ou, optionnellement, utiliser les filtres des formats d\'entrée que propose Drupal pour gérer en toute sécurité des textes enrichis. Les champs de saisie de texte peuvent être constitués d\'une seule ligne (champ texte), de plusieurs lignes (zone de texte) ou, pour un meilleur contrôle des valeurs saisies, une liste de sélection, des cases à cocher ou des boutons radio. Si besoin, CCK peut valider les saisies sur la base d\'un ensemble de valeurs autorisées.','fr',0,0),(349,'<em>Node Reference</em>, qui crée des références personnalisées entre nœuds de Drupal. En ajoutant, par exemple, un champ <em>nodereference</em> et deux types de contenus différents, vous pouvez facilement créer des relations complexes de type parent/enfant entre données (par exemple plusieurs nœuds \"employé\" peuvent présenter un champ <em>nodereference</em> pointant vers un même nœud \"employeur\").','fr',0,0),(350,'<em>User reference</em>, qui crée des références personnalisées vers les comptes des utilisateurs de votre site. En ajoutant un champ <em>userreference</em>, vous pouvez créer des relations complexes entre les utilisateurs de votre site et des publications. Ainsi, pour tracer l\'implication d\'un utilisateur dans une publication (au delà du champ Drupal standard <em>Écrit par</em>), vous pouvez ajouter à un type de contenu un champ <em>userreference</em> intitulé \"Édité par\" pour enregistrer un lien vers la page du compte utilisateur ayant édité la publication.','fr',0,0),(351,'<em>Fieldgroup</em>, qui crée des groupes de champs liés. Les groupes de champ peuvent être repliés, et vous pouvez choisir qu\'ils soient dépliés ou repliés par défaut. L\'ordre des groupes de champs, ainsi que l\'ordre des champs au sein d\'un groupe, est géré grâce à l\'interface par glisser-déposer fournie par le module Content.','fr',0,0),(352,'Pour plus d\'informations, reportez-vous à l\'entrée de manuel en ligne relative à <a href=\"@handbook-cck\">CCK</a> ou à la <a href=\"@project-cck\">page du projet CCK</a>.','fr',0,0),(353,'Ce champ est obligatoire.','fr',0,0),(35