age','fr',0,0),(246,'La taille maximum autorisée pour une image (640X480 par exemple). Régler sur 0 pour qu\'il n\'y ait pas de restriction. Si une <a href=\"!image-toolkit-link\">trousse à outil image</a> est installée, les fichiers excédant cette valeur seront redimenssionnés pour respecter cette contrainte.','fr',0,0),(247,'LARGEURXHAUTEUR','fr',0,0),(248,'Nombre maximum de fichiers par opération','fr',0,0),(249,'Vous pouvez permettre aux utilisateurs de sélectionner plusieurs fichiers pour les opérations telles que supprimer, redimensionner, etc. Toute l\'opération est exécutée lors d\'un unique chargement ce qui peut être utile. Cependant, le temps d\'exécution du script sera rallongé et la consommation de CPU et de mémoire vive peut exéder les limites du serveur, ce qui n\'est pas cool ,-) Pour traiter un nombre illimité de fichier, régler sur 0.','fr',0,0),(250,'Les modifications ont été enregistrées.','fr',0,0),(251,'Le profil a été ajouté.','fr',0,0),(252,'Incluant les sous répertoires.','fr',0,0),(253,'Naviguer','fr',0,0),(255,'Vignettes','fr',0,0),(256,'Redimensionner','fr',0,0),(257,'Chemin du répertoire','fr',0,0),(258,'Répertoires','fr',0,0),(259,'Définir les répertoires que les utilisateurs ayant ce profil peuvent atteindre.\n<ul>\n	<li>Utiliser des caractères alphanumériques pour les chemins de répertoires.</li>\n	<li>Pour préciser la racine du système de fichiers, ne saisissez que \"<strong>.</strong>\".</li>\n	<li>Utiliser <strong>%uid</strong> comme placeholder pour l\'ID utilisateur. Exemple : <em>users/user%uid</em> créé des répertoires tels que <em>users/user1</em>, <em>users/user42</em>, etc.</li>\n  <li>Pour enlever un répertoire de la liste, laisser son chemin vide.</li>\n  <li>Si vous voulez plus de flexibilité pour les chemins de répertoires vous pouvez exécuter PHP pour qu\'il retourne le chemin du répertoire.<br />\n  Pour exécuter PHP, votre chemin de répertoire doit commencer par <strong>php:</strong> et la suite doit être un code PHP valide qui est supposé retourner le chemin du répertoire courant. <br />Exemple : <strong>php: return \'users/\'.$user->name;</strong> retourne <strong>users/USER-NAME</strong> comme chemin du répertoire.<br />\n  Exemple avec plusieurs niveaux : <strong>php: return date(\'Y\', $user->created).\'/\'.date(\'m\', $user->created).\'/\'.$user->uid;</strong> retourne <strong>MEMBERSHIP-YEAR/MONTH/USER-ID</strong> comme chemin du répertoire, avec des répertoires utilisateurs classés automatiquement par date de création de compte.<br />\n  Notez que vous devez utiliser la variable $user plutôt que $GLOBALS[\'user\'] car ce n\'est pas toujours le même objet.</li>\n</ul>\n<p>Notez que les droits des vignettes n\'affectent pas la création des vignettes lors du téléversement. Voir la description des vignettes ci-dessous.</p>\n<p>Si vous avez besoin de plus de champs, remplissez tous les champs et sauvegardez, et vous obtiendrez deux champs supplémentaires sur la page suivante.</p>','fr',0,0),(261,'Dimensions','fr',0,0),(264,'Vous devriez créer une liste de types de vignettes parmi lesquelles les utilisateurs choisiront.\n<ul>\n  <li>Utiliser des caractères alphanumériques pour les noms des vignettes.</li>\n  <li>Précisez les dimensions sous la forme <strong>LargeurxHauteur</strong>.</li>\n  <li>Les préfixes et les suffixes sont des chaînes de caractères ajoutés pour créer le nom des vignettes.</li>\n  <li>Exemple de vignette : Nom = <strong>Small</strong>, Dimensions = <strong>80x80</strong>, Préfixe = <strong>small_</strong></li>\n</ul>\n<p>Notez que les utilisateurs pourront toujours créer des vignettes des fichiers téléversés quelque soit le droit sur les vignettes. pour désactiver la création de vignettes lors du téléversement vous devez définir aucune vignette içi.</p>\n<p>Si vous avez besoin de plus de champs, renseignez ceux disponibles et sauvegardez, vous obtiendrez deux champs supplémentaires sur la page suivante.</p>','fr',0,0),(265,'Êtes vous sûr de vouloir supprim